import React from 'react'
import "./Posts.css"

const Input = props => {
    return (
        <input className="input"
        value={props.value}
        className={props.className}
        type={props.type}
        placeholder={props.placeholder}
        onChange={props.onChange}
      ></input>
    )
}


export default Input
